def check_colour_abbr(colour):
    result=colour_abbreviation.get(colour,colour)
    return result

def seek_colour(str):
    result=[]
    words=str.split(' ')
    for word in words:
        colour=colour_abbreviation.get(word.strip().upper())
        if colour:
            result.append(colour)
    return result

def init_products_db(product_list,signal_display=None):
    '''
    this function is to initiate the database at the table fabric and products
    1st step is to load the data to table fabric, 2nd is to load data to products
    :return: the number of 2 tables
    '''
    #delete current fabric records

    logger.info('start to initiate product table including Fabri and Product\n deleting current fabric')
    signal_display.emit({'msg':'start to initiate product table including Fabri and Product\n deleting current fabric','level':'INFO'})
    try:
        Fabric.objects.all().delete()
    except Exception as e:
        logger.error(' error when delete fabric: {0}'.format(e))
        return
    #create Fabric table from fabric_list
    for fabric in fabric_tup:
        try:
            f1=Fabric.objects.create(**{'fabric':fabric[0],'nickname':fabric[1]})
        except Exception as e:
            logger.error(' error when create fabric {0} {1}: {2}'.format(fabric[0],fabric[1],e))
            return
        logger.info('  create fabric {0}'.format(f1))
        signal_display.emit({'msg': '  create fabric {0}'.format(f1),'level': 'INFO'})

    #delete current products
    logger.info('  deleting current products')
    signal_display.emit({'msg': '  deleting current products','level': 'INFO'})
    Product.objects.all().delete()
    #create product table from product_detail
    for product in product_list:
        try:
            logger.info('\n    start parse product {0}'.format(product))
            logger.debug('  Looking for fabric {0}'.format(product.get('fabric').strip()))
            fabric=Fabric.objects.get(fabric__iexact=product.get('fabric').strip())
            logger.debug('  creating product form detail {0}'.format(product))
            product_set={'style_no':product.get('style'),'client':product.get('client'),
                         'commodity':product.get('commidity'),
                         'fabric':fabric,'fabric_usage':float('0'+product.get('usage',0)),
                         'quantity_per_carton':int('0'+product.get('pcs',0)),
                         'volume_per_carton':float('0'+product.get('volume',0)),
                         'weight_per_carton':float('0'+product.get('weight',0))}
            new_product=Product.objects.create(**product_set)
            logger.info('  created Product {0}'.format(new_product))
            signal_display.emit({'msg': '  created Product {0}'.format(new_product), 'level': 'INFO'})
        except Fabric.DoesNotExist:
            logger.error('  fabric {0} does not match in Fabric '.format(product.get('fabric').strip()))
            signal_display.emit({'msg':   'fabric {0} does not match in Fabric '.format(product.get('fabric').strip()), 'level': 'ERROR'})
            continue
        except Exception as e:
            logger.error('  error occurs when creating product: {0}'.format(e))
            signal_display.emit(
                {'msg': '  error occurs when creating product: {0}'.format(e), 'level': 'ERROR'})
            continue
    logger.info('Finish the Production initiation')
    signal_display.emit({'msg': 'Finish the Production initiation', 'level': 'INFO'})

def parse_product(signal_display=None):
    #logger.debug('the Base_DIR={0}, Project_Dir={1}'.format(settings.BASE_DIR,settings.PROJECT_DIR))
    file_product=os.path.normpath(os.path.join(settings.BASE_DIR+'\media\product.csv'))
    logger.debug('the product csv file is {0}'.format(file_product))
    signal_display.emit({'msg':'the product csv file is {0}'.format(file_product),'level':'INFO'})
    product_list=[]
    try:
        with open(file_product) as f:
            for line in f:
                logger.debug('get line={0}'.format(line))
                if line.startswith('Client'):
                    continue
                '''
                match1=re.match(r'(.*),(.*),(.*),(.*),(.*),(.*),(.*)',line)
                if match1:
                    client=match1.group(1).strip()
                    style=match1.group(2).strip()
                    usage=match1.group(3).strip()
                    pcs=match1.group(4).strip()
                    volume=match1.group(5).strip()
                    weight=match1.group(6).strip()
                    fabric=match1.group(7).strip()
                '''
                words=line.split(',')
                logger.debug(' split to get {0}'.format(words))
                client = words[0].strip()
                style = words[1].strip()
                usage = words[2].strip()
                pcs = words[3].strip()
                volume = words[4].strip()
                weight = words[5].strip()
                fabric=words[6].strip('\n').strip('"')
                for index in range(7,len(words)):
                    fabric = '{0},{1}'.format(fabric,words[index].strip('\n').strip('"'))

                product={'style':style,'volume':volume,'weight':weight,'usage':usage,'client':client,'fabric':fabric.strip(),'pcs':pcs}
                logger.debug('parse product {0}'.format(product))
                product_list.append(product)
                '''
                else:
                    logger.debug( ' not match {0}'.format(line))
                '''
    except Exception as e:
        logger.error(' error occurs when open file {0}'.format(e))
        signal_display.emit({'msg': ' error occurs when open file {0}'.format(e), 'level': 'ERROR'})
    logger.info('finish parse product.csv, get{0}'.format(product_list))
    signal_display.emit({'msg': 'finish parse product.csv', 'level': 'INFO'})
    return product_list

